    private async void HandleValidSubmit()
    {
        if (TaskObject.Id == 0)
        {
            await service.Add(TaskObject);
        }
        else
        {
            await service.Update(TaskObject);
        }
        await CloseTaskModal();
        DataChanged?.Invoke();
    }

